In Summer (Le Rayon vert / The Green Ray), Rohmer tells the story of Delphine,
a discontented young woman who has just broken up with her boyfriend. She
lives in Paris, which empties every August as the Parisians stage a mass
exodus to the mountains or the seashore. She makes plans to spend her
holiday with a girlfriend, but then, at the last moment, the girlfriend
switches plans and Delphine is left to spend her vacation by herself.

